import React from 'react';
import Input from "./components/input";
import Grid from "./components/grid";

function App() {
  return (
    <div className="App">
      <Grid>
        <Grid size="2" gapY="0px">
          <Input label="Break length" placeholder="in minutes" type="number"/>
          <Input label="Session length" placeholder="in minutes" type="number"/>
        </Grid>
        <div className="btn-group">
        </div>
      </Grid>
    </div>
  );
}

export default App;
